    static boolean flag[][];
    static boolean flag1[][];
    static int m, n;

    public static int closedIsland(int[][] grid) {
        int count = 0;
        m = grid.length;
        n = grid[0].length;
        flag = new boolean[m][n];
        flag1 = new boolean[m][n];
        for (int i = 0; i < n; i++) {
            if (flag1[0][i])
                continue;
            if (grid[0][i] == 0) {
                flag1[0][i] = true;
                helpI(0, i, grid, 1);
            }
        }
        for (int i = 0; i < m; i++) {
            if (flag1[i][0])
                continue;
            if (grid[i][0] == 0) {
                flag1[i][0] = true;
                helpI(i, 0, grid, 1);
            }
        }
        for (int i = 0; i < m; i++) {
            if (flag1[i][n - 1])
                continue;
            if (grid[i][n - 1] == 0) {
                flag1[i][n - 1] = true;
                helpI(i, n - 1, grid, 1);
            }
        }
        for (int i = 0; i < n; i++) {
            if (flag1[m - 1][i])
                continue;
            if (grid[m - 1][i] == 0) {
                flag1[m - 1][i] = true;
                helpI(m - 1, i, grid, 1);
            }
        }
        for (int i = 1; i < m; i++) {
            for (int j = 1; j < n; j++) {
                if (grid[i][j] == 1 || flag[i][j] || flag1[i][j])
                    continue;
                boolean f[][] = new boolean[m][n];
                f[i][j] = true;
                boolean fl = help(i - 1, j, grid, f);
                if (!fl) {
                    helpI(i, j, grid, 1);
                    continue;
                }
                fl = help(i + 1, j, grid, f);
                if (!fl) {
                    helpI(i, j, grid, 1);
                    continue;
                }
                fl = help(i, j + 1, grid, f);
                if (!fl) {
                    helpI(i, j, grid, 1);
                    continue;
                }
                fl = help(i, j - 1, grid, f);
                if (!fl) {
                    helpI(i, j, grid, 1);
                    continue;
                }
                if (fl) {
                    count++;
                    helpI(i, j, grid, 0);
                }
            }
        }
        return count;
    }

    public static boolean help(int row, int col, int[][] grid, boolean f[][]) {
        if (row >= m || row < 0 || col >= n || col < 0) {
            return false;
        }
        //如果是山成功
        if (grid[row][col] == 1)
            return true;
        //已经访问过也为成功
        if (f[row][col])
            return true;
        f[row][col] = true;
        //四个方向都判断
        boolean f1 = true;
        f1 = help(row - 1, col, grid, f);
        if (!f1)
            return false;
        f1 = help(row + 1, col, grid, f);
        if (!f1)
            return false;
        f1 = help(row, col + 1, grid, f);
        if (!f1)
            return false;
        f1 = help(row, col - 1, grid, f);
        if (!f1)
            return false;
        return true;
    }

    public static void helpI(int row, int col, int[][] grid, int tmp) {
        if (row >= m || row < 0 || col >= n || col < 0 || grid[row][col] == 1) {
            return;
        }
        if (flag[row][col] || flag1[row][col])
            return;
        if (tmp == 0)
            flag[row][col] = true;
        if (tmp == 1)
            flag1[row][col] = true;
        helpI(row - 1, col, grid, tmp);
        helpI(row + 1, col, grid, tmp);
        helpI(row, col - 1, grid, tmp);
        helpI(row, col + 1, grid, tmp);
    }
